window.onload = function () {
  // 修改页面的 adDivContent广告 元素
  const adDivContent = document.getElementById('adDivContent')
  if (adDivContent != null || adDivContent != undefined) {
    // 样式
    adDivContent.style = 'position: fixed;width: 200px;top: 100px;right: 5px;text-align: center;line-height: 5px;'
    // 内容
    let updateContent = '<div style="position: relative;">'
    updateContent += '<img src="' + base64Image + '" style="width: 100%;height: 100%;"/>'
    updateContent += '<span style="position: absolute;right: 10px;color: red;top: 12px;font-size: 16px;font-weight: 900;cursor: pointer;" onclick="closeAdDiv()">关闭</span>'
    updateContent += '</div>'
    updateContent += '<p><a href="" style=""  target="_blank">最新网址</a></p>'
    updateContent += '<p><a href="https://blog.csdn.net/qq_40739917" style="" target="_blank">CSDN@头上一片天空</a></p>'
    adDivContent.innerHTML = updateContent
  }


  // 首页增加额外内容
  const mainHomeParentNode = document.getElementById('main-home').parentNode
  if (mainHomeParentNode != null || mainHomeParentNode != undefined) {

    // 新增一个DIV元素
    const additionalDiv = document.createElement('div')
    additionalDiv.id = "additionalDiv"
    // 样式
    additionalDiv.style = 'position: fixed;width: 200px;top: 100px;right: 5px;text-align: center;line-height: 5px;'

    // 内容
    let additionalDivContent = '<divstyle="position: relative;">'
    additionalDivContent += '<img src="' + base64Image + '" style="width: 100%;height: 100%;" referrerpolicy="no-referrer"/>'
    additionalDivContent += '<span style="position: absolute;right: 10px;color: red;top: 12px;font-size: 16px;font-weight: 900;cursor: pointer;" onclick="closeMainHomeAdDiv()">关闭</span>'
    additionalDivContent += '</div>'
    additionalDivContent += '<p><a href="" style=""  target="_blank">最新网址</a></p>'
    additionalDivContent += '<p><a href="https://blog.csdn.net/qq_40739917" style="" target="_blank">CSDN@头上一片天空</a></p>'

    additionalDiv.innerHTML = additionalDivContent
    mainHomeParentNode.appendChild(additionalDiv)
  }
}

function closeAdDiv() {
  const adDivContent = document.getElementById('adDivContent')
  adDivContent.style = 'display: none;'
}
function closeMainHomeAdDiv() { 
  const additionalDiv = document.getElementById('additionalDiv')
  if (additionalDiv != null || additionalDiv != undefined) {
    additionalDiv.style = 'display:none;'
   }

}

